Eſſars (Charlotte) Koͤnig Heinrichs des IV, und dann des Cardinals von Guiſe Beyſchlaͤferinnᵃ, hat ſich mit dem
allein hier muß ich einen Fehler verbeſſern, der mir Marſchalle von Hoſpital vermaͤhlt, wie ich anderswo geſaget habeᵇ;
entwiſcht iſt (A), und dazu ſetzen, daß ſich dieſe Dame zu ſehr in große Staatshaͤndel gemiſcht hat (B).
